import { useCallback } from "react";

const CustomButton: React.FC = () => {
    const handleClick = useCallback(() => {
        console.log('クリックされました');
    },[]);
    return (
        <ul>
            <button
            // key={ index }
            onClick={ handleClick }
            >
                <li>
                    ABC
                </li>
            </button>
        </ul>
    );
};

export default CustomButton;
